(87, 1, 10, 'AW21-1015', 'Dans chaque page Web,  l''information ne doit pas être donnée par la forme ou la position uniquement. Cette règle est-elle implémentée de façon pertinente ?', '10.15', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-10-15 ', 87),
(88, 1, 11, 'AW21-1101', 'Chaque champ de formulaire a-t-il une étiquette ?', '11.1', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-1 ', 88),
(89, 1, 11, 'AW21-1102', 'Chaque étiquette associée à un champ de formulaire est-elle pertinente ?', '11.2', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-2 ', 89),
(90, 1, 11, 'AW21-1103', 'Dans chaque formulaire,  chaque étiquette associée à un champ de formulaire ayant la même fonction et répétés plusieurs fois dans une même page ou dans un ensemble de page est-elle cohérente ?', '11.3', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-3 ', 90),
(91, 1, 11, 'AW21-1104', 'Dans chaque formulaire,  chaque étiquette de champ et son champ associé sont-ils accolés ?', '11.4', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-4 ', 91),
(92, 1, 11, 'AW21-1105', 'Dans chaque formulaire,  les informations de même nature sont-elles regroupées,  si nécessaire ?', '11.5', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-5 ', 92),
(93, 1, 11, 'AW21-1106', 'Dans chaque formulaire,  chaque regroupement de champs de formulaire a-t-il une légende ?', '11.6', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-6 ', 93),
(94, 1, 11, 'AW21-1107', 'Dans chaque formulaire,  chaque légende associée à un groupement de champs de formulaire est-elle pertinente ?', '11.7', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-7 ', 94),
(95, 1, 11, 'AW21-1108', 'Dans chaque formulaire,  chaque liste de choix est-elle structurée de manière pertinente ?', '11.8', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-8 ', 95),
(96, 1, 11, 'AW21-1109', 'Dans chaque formulaire,  l''intitulé de chaque bouton est-il pertinent ?', '11.9', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-9 ', 96),
(97, 1, 11, 'AW21-1110', 'Dans chaque formulaire,  le contrôle de saisie est-il utilisé de manière pertinente ?', '11.10', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-10 ', 97),
(98, 1, 11, 'AW21-1111', 'Dans chaque formulaire,  le contrôle de saisie est-il accompagné,  si possible,  de suggestions facilitant la correction des erreurs de saisie ?', '11.11', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-11 ', 98),
(99, 1, 11, 'AW21-1112', 'Pour chaque formulaire,  les données à caractère financier,  juridique ou personnel peuvent-elles être modifiées,  mise à jour ou récupérées par l''utilisateur ?', '11.12', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-12 ', 99),
(100, 1, 11, 'AW21-1113', 'Pour chaque formulaire,  toutes les données peuvent-elles être modifiées,  mises à jour ou récupérées par l''utilisateur ?', '11.13', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-13 ', 100),
(101, 1, 11, 'AW21-1114', 'Pour chaque formulaire,  des aides à la saisie sont-elles présentes ?', '11.14', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-14 ', 101),
(102, 1, 11, 'AW21-1115', 'Pour chaque formulaire,  chaque aide à la saisie est-elle pertinente ?', '11.15', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-11-15 ', 102),
(103, 1, 12, 'AW21-1201', 'Chaque ensemble de pages dispose-t-il de deux systèmes de navigation différents,  au moins (hors cas particuliers) ?', '12.1', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-1 ', 103),
(104, 1, 12, 'AW21-1202', 'Dans chaque ensemble de pages,  le menu ou les barres de navigation sont-ils toujours à la même place (hors cas particuliers) ?', '12.2', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-2 ', 104),
(105, 1, 12, 'AW21-1203', 'Dans chaque ensemble de pages,  le menu et les barres de navigation ont-ils une présentation cohérente (hors cas particuliers) ?', '12.3', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-3 ', 105),
(106, 1, 12, 'AW21-1204', 'La page "plan du site" est-elle pertinente ?', '12.4', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-4 ', 106),
(107, 1, 12, 'AW21-1205', 'Dans chaque ensemble de pages,  la page "plan du site" est-elle atteignable de manière identique ?', '12.5', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-5 ', 107),
(108, 1, 12, 'AW21-1206', 'Dans chaque ensemble de pages,  le moteur de recherche est-il atteignable de manière identique ?', '12.6', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-6 ', 108),
(109, 1, 12, 'AW21-1207', 'Dans chaque page d''une collection de pages,  des liens facilitant la navigation sont-ils présents ?', '12.7', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-7 ', 109),
(110, 1, 12, 'AW21-1208', 'Dans chaque page web,  un fil d''Ariane est-il présent ?', '12.8', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-8 ', 110),
(111, 1, 12, 'AW21-1209', 'Dans chaque page Web,  le fil d''Ariane est-il pertinent ?', '12.9', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-9 ', 111),
(112, 1, 12, 'AW21-1210', 'Dans chaque page Web,  les groupes de liens importants (menu,  barre de navigation...) et la zone de contenu sont-ils identifiés ?', '12.10', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-10 ', 112),
(113, 1, 12, 'AW21-1211', 'Dans chaque page Web,  des liens d''évitements ou d''accès rapide aux groupes de liens importants et à la zone de contenu sont-ils présents ?', '12.11', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-11 ', 113),
(114, 1, 12, 'AW21-1212', 'Dans chaque page Web,  la page en cours de consultation est-elle indiquée dans le menu de navigation ?', '12.12', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-12 ', 114),
(115, 1, 12, 'AW21-1213', 'Dans chaque page Web,  l''ordre de tabulation est-il cohérent ?', '12.13', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-13 ', 115),
(116, 1, 12, 'AW21-1214', 'Dans chaque page Web,  la navigation ne doit pas contenir de piège au clavier. Cette règle est-elle respectée ?', '12.14', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-12-14 ', 116),
(117, 1, 13, 'AW21-1301', 'Pour chaque page Web,  l''utilisateur a-t-il le contrôle de chaque limite de temps modifiant le contenu (hors cas particuliers) ?', '13.1', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-1 ', 119),
(118, 1, 13, 'AW21-1302', 'Dans chaque page Web,  pour chaque ouverture de nouvelle fenêtre,  l''utilisateur est-il averti ?', '13.2', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-2 ', 118),
(119, 1, 13, 'AW21-1303', 'Dans chaque page Web,  l''ouverture d''une nouvelle fenêtre ne doit pas être déclenchée sans action de l''utilisateur. Cette règle est-elle respectée ?', '13.3', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-3 ', 119),
(120, 1, 13, 'AW21-1304', 'Dans chaque page Web,  une tâche ne doit pas requérir de limite de temps pour être réalisée,  sauf si elle se déroule en temps réel ou si cette limite de temps est essentielle. Cette règle est-elle respectée ?', '13.4', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-4 ', 120),
(121, 1, 13, 'AW21-1305', 'Dans chaque page Web,  lors d''une interruption de session authentifiée,  les données saisies par l''utilisateur sont-elles récupérées après ré-authentification ?', '13.5', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-5 ', 121),
(122, 1, 13, 'AW21-1306', 'Dans chaque page Web,  pour chaque fichier en téléchargement,  des informations relatives à sa consultation sont-elles présentes ?', '13.6', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-6 ', 122),
(123, 1, 13, 'AW21-1307', 'Dans chaque page Web,  chaque document bureautique en téléchargement possède-t-il,  si nécessaire,  une version accessible (hors cas particuliers) ?', '13.7', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-7 ', 123),
(124, 1, 13, 'AW21-1308', 'Pour chaque document bureautique ayant une version accessible,  cette version offre-t-elle la même information ?', '13.8', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-8 ', 124),
(125, 1, 13, 'AW21-1309', 'Dans chaque page Web,  les expressions inhabituelles,  les expressions idiomatiques ou le jargon sont-ils explicités ?', '13.9', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-9 ', 125),
(126, 1, 13, 'AW21-1310', 'Dans chaque page Web,  pour chaque expression inhabituelle ou limitée,  idiomatique ou de jargon ayant une définition,  cette définition est-elle pertinente ?', '13.10', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-10 ', 126),
(127, 1, 13, 'AW21-1311', 'Dans chaque page Web,  chaque contenu cryptique (art ascii,  émoticon,  syntaxe cryptique) a-t-il une alternative ?', '13.11', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-11 ', 127),
(128, 1, 13, 'AW21-1312', 'Dans chaque page Web,  pour chaque contenu cryptique (art ascii,  émoticon,  syntaxe cryptique) ayant une alternative,  cette alternative est-elle pertinente ?', '13.12', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-12 ', 128),
(129, 1, 13, 'AW21-1313', 'Dans chaque page Web,  pour chaque mot dont le sens ne peut être compris sans en connaître la prononciation,  celle-ci est-elle indiquée ?', '13.13', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-13 ', 129),
(130, 1, 13, 'AW21-1314', 'Dans chaque page Web,  chaque texte qui nécessite un niveau de lecture plus avancé que le premier cycle de l''enseignement secondaire a-t-il une version alternative ?', '13.14', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-14 ', 130),
(131, 1, 13, 'AW21-1315', 'Dans chaque page Web,  les changements brusques de luminosité ou les effets de flash sont-ils correctement utilisés ?', '13.15', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-15 ', 131),
(132, 1, 13, 'AW21-1316', 'Dans chaque page Web,  les changements brusques de luminosité ou les effets de flash ont-ils une fréquence inférieure ou égale à 3 par seconde ?', '13.16', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-16 ', 132),
(133, 1, 13, 'AW21-1317', 'Dans chaque page Web,  chaque contenu en mouvement ou clignotant est-il contrôlable par l''utilisateur ?', '13.17', 'http://www.braillenet.org/accessibilite/referentiel-aw21/index.php#crit-13-17 ', 133);
